import { connect } from "react-redux";
import Auction from './Auction'
import ViewAuction from './ViewAuction'
import { setCurrentAuction } from '../../store/actions/currentAuction'
import { Link, BrowserRouter as Router } from 'react-router-dom';

const AuctionList = (props) => {
    return (
        <Router>
            {props.arr.map((item) => {
                return (
                    <Link key={parseInt(item.code)} onClick={() => setCurrentAuction(item.code)} to={`/auction:${item.code}`} component={ViewAuction}>
                        <Auction key={parseInt(item.code)} item={item} />
                    </Link>)
            })}
        </Router>
    );
}
const mapStateToProps = (state) => {
    return {
        arr: state.main.auctionsList,
    }
}

export default connect(mapStateToProps, { setCurrentAuction })(AuctionList);
